import { Radar, RadarChart, PolarGrid, PolarAngleAxis, ResponsiveContainer } from 'recharts';

import "./RadarsChart.css";

function RadarsChart() {

    const data = [
        {
          "subject": "Intensité",
          "A": 17,
          "fullMark": 40
        },
        {
          "subject": "Vitesse",
          "A": 32,
          "fullMark": 40
        },
        {
          "subject": "Force",
          "A": 28,
          "fullMark": 40
        },
        {
          "subject": "Endurance",
          "A": 32,
          "fullMark": 40
        },
        {
          "subject": "Energie",
          "A": 30,
          "fullMark": 40
        },
        {
          "subject": "Cardio",
          "A": 25,
          "fullMark": 40
        }
      ]



    return (
        <ResponsiveContainer width="100%" height={263}>
          <RadarChart cx="50%" cy="50%" outerRadius="70%" data={data}>
          <PolarGrid radialLines={false}/>
            <PolarAngleAxis dataKey="subject" tick={{ fill: "white", fontSize: 12 }}/>
            <Radar name={"mike"} dataKey="A" stroke="#E60000" fill="#E60000" fillOpacity={0.8} />
          </RadarChart>
        </ResponsiveContainer>
      );
}

export default RadarsChart;
